sources.scss/hamburger.scss:
.hamburger {
    padding: 32px 30px;
    display: block;
}

.hamburger__container {
    width: 32px;
    height: 22px;
    position: relative;
}

.hamburger__line {
    position: absolute;
    left: 0;
    width: 100%;
    height: 2px;
    background: #fff;
    border-radius: 6px;
    opacity: 0.8;

    &:nth-child(2) {
        top: 10px;
    }

    &:nth-child(3) {
        top: 20px;
    }
}

.is--menu-active .hamburger__line {
    &:nth-child(1) {
        animation: hamburger__line--first .3s ease forwards;
    }

    &:nth-child(2) {
        animation: hamburger__line--second .3s ease forwards;
    }

    &:nth-child(3) {
        animation: hamburger__line--third .3s ease forwards;
    }
}

@keyframes hamburger__line--first {
    0% {
        transform: translate(0, 0);
    }
    50% {
        transform: translate(0, 10px);
    }
    100% {
        transform: translate(0, 10px) rotate(45deg);
    }
}

